import React from 'react';
import {Link} from 'react-router-dom';
const Nav = _ => {
  return (
    <nav>
      <h3>logo</h3>
      <div className="nav-links-container">
        <Link to="/coming-soon">
          <span className="nav-link">Coming Soon</span>
        </Link>
        <Link to="/favorites">
          <span className="nav-link">Favorites</span>
        </Link>
      </div>
    </nav>
  )
}

export default Nav;
